import React from 'react';
import { motion, useAnimation } from 'framer-motion';

import './contact.css';

interface Contact {
    darkMode: boolean;
    contactRef: React.MutableRefObject<HTMLDivElement | null>;
}

export default function Contact(props:Contact) {
    const { darkMode, contactRef } = props;
    const variants = {
        hidden: {
            opacity: 0,
        },
        visible: {
            opacity: 1,
            transition: {
                staggerChildren: 0.5
            }
        }
    }
    return (
        <motion.div className={`contact page ${darkMode && "dark"}`}
        ref={contactRef}
        initial='hidden'
        animate='visible'
        variants={variants}
        >
              <motion.img src={require(`../../assets/contact/${darkMode ? "githubDM.png" : "github.png"}`)} className='contact-icon' alt="Github" />
        </motion.div>
    )
}
